script: |
  super -f tsv -I q9996.sql | sort > q9996.out

vector: true

inputs:
  - name: q9996.sql
    data: |
      SELECT - 70 / 73 + + col0 AS col2 FROM tab1 WHERE + col2 + - + col0 + col0 = 1 * - COALESCE ( - 76, - col0 ) GROUP BY col0 HAVING NULL = - 79;
  - name: tab1

outputs:
  - name: q9996.out
    data: |
